'use client'
import { useState, useEffect } from 'react';
import { Heart, Search, ShoppingCart, User } from 'lucide-react';
import { Link } from 'react-router-dom';
import { Button } from "./ui/button";
import { Input } from "./ui/input";
import { Select, SelectContent, SelectItem, SelectTrigger, SelectValue } from "./ui/select";
import { Card, CardContent, CardFooter, CardHeader, CardTitle } from "./ui/card";
import { Badge } from "./ui/badge";
import Navbar from './Navbar';

type Car = {
  _id: string;
  model: string;
  brand: string;
  pricePerDay: number;
  discount: number;
  category: string;
  images: string[];
};

export default function HomePage() {
  const [cars, setCars] = useState<Car[]>([]);
  const [categories, setCategories] = useState<string[]>([]);
  const [brands, setBrands] = useState<string[]>([]);
  const [selectedCategory, setSelectedCategory] = useState("All");
  const [selectedBrand, setSelectedBrand] = useState("All");
  const [searchTerm, setSearchTerm] = useState("");

  useEffect(() => {
    fetchCars();
  }, []);

  const fetchCars = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/cars');
      const data: Car[] = await response.json();
      setCars(data);

      const uniqueCategories = Array.from(new Set(data.map(car => car.category)));
      const uniqueBrands = Array.from(new Set(data.map(car => car.brand)));

      setCategories(['All', ...uniqueCategories]);
      setBrands(['All', ...uniqueBrands]);
    } catch (error) {
      console.error('Error fetching cars:', error);
    }
  };

  const filteredCars = cars.filter(car =>
    (selectedCategory === "All" || car.category === selectedCategory) &&
    (selectedBrand === "All" || car.brand === selectedBrand) &&
    (car.model.toLowerCase().includes(searchTerm.toLowerCase()) || 
     car.brand.toLowerCase().includes(searchTerm.toLowerCase()))
  );

  const discountedCars = filteredCars.filter(car => car.discount > 0);

  return (
    <div className="min-h-screen bg-gray-100">
      <Navbar />
      <div className="container mx-auto px-4 py-8">
        <h1 className="text-3xl font-bold text-center mb-8">Explore Our Cars</h1>
        <div className="flex justify-between items-center mb-8">
          <Input 
            placeholder="Search for cars by model or brand"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            className="w-1/3"
          />
          <Select value={selectedCategory} onValueChange={setSelectedCategory}>
            <SelectTrigger>
              <SelectValue placeholder="Filter by Category" />
            </SelectTrigger>
            <SelectContent>
              {categories.map(category => (
                <SelectItem key={category} value={category}>{category}</SelectItem>
              ))}
            </SelectContent>
          </Select>
          <Select value={selectedBrand} onValueChange={setSelectedBrand}>
            <SelectTrigger>
              <SelectValue placeholder="Filter by Brand" />
            </SelectTrigger>
            <SelectContent>
              {brands.map(brand => (
                <SelectItem key={brand} value={brand}>{brand}</SelectItem>
              ))}
            </SelectContent>
          </Select>
        </div>
        <main>
          <section className="mb-12">
            <h2 className="text-2xl font-semibold mb-4">Discounted Cars</h2>
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
              {discountedCars.map(car => (
                <CarCard key={car._id} car={car} />
              ))}
            </div>
          </section>
          <section>
            <h2 className="text-2xl font-semibold mb-4">All Cars</h2>
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
              {filteredCars.map(car => (
                <CarCard key={car._id} car={car} />
              ))}
            </div>
          </section>
        </main>
      </div>
    </div>
  );
}

function CarCard({ car }: { car: Car }) {
  return (
    <Card>
      <Link to={`/cars/${car._id}`} className="block">
        <CardHeader>
          <img src={car.images[0] || "/placeholder.svg"} alt={car.model} className="w-full h-48 object-cover" />
        </CardHeader>
        <CardContent>
          <h3 className="font-semibold">{car.brand} - {car.model}</h3>
          <div className="flex items-center justify-between mt-2">
            {car.discount > 0 ? (
              <div>
                <span className="text-lg font-bold">${(car.pricePerDay * (1 - car.discount / 100)).toFixed(2)} / day</span>
                <span className="text-sm text-gray-500 line-through ml-2">${car.pricePerDay.toFixed(2)}</span>
              </div>
            ) : (
              <span className="text-lg font-bold">${car.pricePerDay.toFixed(2)} / day</span>
            )}
            <Badge>{car.category}</Badge>
          </div>
        </CardContent>
      </Link>
      <CardFooter className="flex justify-center">
        <Button variant="default" size="sm">
          Rent Now
        </Button>
      </CardFooter>
    </Card>
  );
}
